-- ----------------------------
-- Table structure for t_card
-- ----------------------------
DROP TABLE IF EXISTS `t_card`;
CREATE TABLE `t_card` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `auth_user_id` bigint(20) NOT NULL COMMENT '所属公众号',
  `card_id` varchar(255) DEFAULT NULL,
  `card_type` varchar(255) DEFAULT NULL COMMENT '团购券：GROUPON; 折扣券：DISCOUNT; 礼品券：GIFT; 代金券：CASH; 通用券：GENERAL_COUPON; 会员卡：MEMBER_CARD; 景点门票：SCENIC_TICKET； 电影票：MOVIE_TICKET； 飞机票：BOARDING_PASS； 会议门票：MEETING_TICKET； 汽车票：BUS_TICKET;',
  `deal_detail` varchar(255) DEFAULT NULL COMMENT '团购券专用字段，团购详情。',
  `discount` int(11) DEFAULT NULL COMMENT '折扣券专用字段，表示打折额度（百分比），例：填30为七折团购详情。',
  `gift` varchar(255) DEFAULT NULL COMMENT '礼品券专用，表示礼品名字。',
  `least_cost` decimal(10,2) DEFAULT NULL COMMENT 'least_cost字段为代金券专用，表示起用金额（单位为分）。',
  `reduce_cost` decimal(10,2) DEFAULT NULL COMMENT '代金券专用，表示减免金额（单位为分）',
  `background_pic_url` varchar(255) DEFAULT NULL,
  `base_info` text COMMENT 'json格式',
  `auto_activate` varchar(16) DEFAULT NULL COMMENT '是否自动激活',
  `wx_activate` varchar(16) DEFAULT NULL,
  `activate_url` varchar(255) DEFAULT NULL,
  `supply_balance` varchar(32) DEFAULT NULL COMMENT '设置一张会员卡支持储值，填写true或false',
  `supply_buy` varchar(255) DEFAULT NULL COMMENT '是否支持购买，跟微信会员卡接口无关',
  `supply_bonus` varchar(255) DEFAULT NULL COMMENT '表示是否支持积分，填写true或false，如填写true，积分相关字段均为必填。',
  `bonus_cleared` varchar(255) DEFAULT NULL COMMENT '积分清零规则。',
  `bonus_rules` varchar(255) DEFAULT NULL COMMENT '积分规则。',
  `balance_rules` varchar(255) DEFAULT NULL COMMENT '储值规则',
  `prerogative` varchar(255) DEFAULT NULL COMMENT '会员卡专属字段，表示特权说明。',
  `bind_old_card_url` varchar(255) DEFAULT NULL COMMENT '绑定旧卡的url。',
  `need_push_on_view` varchar(255) DEFAULT NULL COMMENT '进入会员卡时是否推送事件，填写true或false。',
  `advanced_info` text COMMENT '高级配置项',
  `from` varchar(64) DEFAULT NULL COMMENT '飞机票的起点，上限为18个汉字',
  `to` varchar(64) DEFAULT NULL COMMENT '飞机票的终点，上限为18个汉字。',
  `flight` varchar(255) DEFAULT NULL COMMENT '航班。',
  `departure_time` datetime DEFAULT NULL COMMENT '起飞时间',
  `landing_time` datetime DEFAULT NULL COMMENT '降落时间',
  `check_in_url` varchar(255) DEFAULT NULL COMMENT '在线值机的链接。',
  `gate` varchar(255) DEFAULT NULL COMMENT '登机口。如发生登机口变更，建议商家实时调用该接口变更。',
  `boarding_time` datetime DEFAULT NULL COMMENT '登机时间，只显示“时分”不显示日期。（Unix时间戳格式）',
