CREATE TABLE `t_order_group` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `app_id` bigint(20) DEFAULT NULL,
  `multi_group_id` bigint(20) NOT NULL COMMENT '拼团活动Id',
  `buyer_id` bigint(20) NOT NULL COMMENT '开团者(团长）',
