DROP TABLE IF EXISTS `t_weimo_app_user`;
CREATE TABLE `t_weimo_app_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `seller_id` bigint(20) DEFAULT NULL,
  `app_id` bigint(20) DEFAULT NULL COMMENT '用户从微盟市场上订购的app应用信息',
