  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `seller_id` (`seller_id`),
  CONSTRAINT `t_weimo_app_user_ibfk_1` FOREIGN KEY (`seller_id`) REFERENCES `t_seller_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

