CREATE TABLE `t_plat_user` (
  `id` bigint(1) NOT NULL AUTO_INCREMENT,
  `nick` varchar(50) DEFAULT '',
  `account` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `login_time` datetime DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `login_ip` varchar(20) DEFAULT NULL,
  `login_fail_count` int(11) DEFAULT NULL,
  `active` int(11) DEFAULT '1',
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `account_unq_idx` (`account`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

CREATE TABLE `t_plat_images` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `plat_user_id` bigint(20) NOT NULL,
  `file_type` int(255) DEFAULT NULL COMMENT '1或空为图片，2为视频',
  `img_path` varchar(255) DEFAULT NULL,
  `active` int(11) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL COMMENT '图片标题',
  PRIMARY KEY (`id`),
  KEY `plat_image_id_ref` (`plat_user_id`),
  CONSTRAINT `plat_image_id_ref` FOREIGN KEY (`plat_user_id`) REFERENCES `t_plat_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='运维用户上传的图片';

CREATE TABLE `t_plat_activitys` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `plat_user_id` bigint(20) NOT NULL,
  `name` varchar(255) DEFAULT NULL COMMENT '活动名称',
  `img_path` varchar(255) DEFAULT NULL,
  `explain` varchar(500) DEFAULT NULL COMMENT '活动说明',
  `start_date` date DEFAULT NULL COMMENT '活动开始时间',
  `end_date` date DEFAULT NULL COMMENT '活动结束时间',
  `active` bit(1) DEFAULT NULL COMMENT '停用粉丝增长为：0',
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `plat_user_id_ref_idx` (`plat_user_id`),
  CONSTRAINT `plat_user_id_ref` FOREIGN KEY (`plat_user_id`) REFERENCES `t_plat_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

CREATE TABLE `t_plat_activitys_join` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `app_id` bigint(20) DEFAULT NULL,
  `activity_id` bigint(20) DEFAULT NULL COMMENT '活动id',
  `fans_count` int(11) DEFAULT NULL COMMENT '报名时候的粉丝数',
  `add_fans_count` int(11) DEFAULT NULL,
  `active` bit(1) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `activity_id_ref_idx` (`activity_id`),
  CONSTRAINT `activity_id_ref` FOREIGN KEY (`activity_id`) REFERENCES `t_plat_activitys` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

CREATE TABLE `t_payee` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `app_id` bigint(20) NOT NULL,
  `payee_name` varchar(255) DEFAULT NULL COMMENT '收款人真实姓名',
  `open_id` varchar(255) NOT NULL COMMENT '该用户在平台的openId',
  `active` bit(1) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='企业付款收款人记录表';

CREATE TABLE `t_payment_record` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `payee_id` bigint(20) NOT NULL COMMENT '收款人',
  `cert_id` bigint(20) NOT NULL COMMENT '付款商户Id(平台账户）',
  `app_id` bigint(20) NOT NULL COMMENT '付款商家appId',
  `payment_money` int(11) DEFAULT NULL COMMENT '付款金额',
  `status` bit(1) DEFAULT NULL COMMENT '付款状态：0（失败），1（成功）',
  `explain` varchar(255) DEFAULT NULL COMMENT '付款说明',
  `fail_reason` varchar(255) DEFAULT NULL COMMENT '失败原因',
  `active` bit(1) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `payee_id` (`payee_id`),
  KEY `cert_id` (`cert_id`),
  KEY `app_id` (`app_id`),
  CONSTRAINT `t_payment_record_ibfk_1` FOREIGN KEY (`payee_id`) REFERENCES `t_payee` (`id`),
  CONSTRAINT `t_payment_record_ibfk_2` FOREIGN KEY (`cert_id`) REFERENCES `t_auth_cert` (`id`),
  CONSTRAINT `t_payment_record_ibfk_3` FOREIGN KEY (`app_id`) REFERENCES `t_auth_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COMMENT='企业付款记录表';
