INSERT INTO `t_product` VALUES ('19', '9', 'P20170503140342356012', '文化人的文化衫【大咖价99元】限88件，额满为止', '688', null, 'M00/00/40/eExPzlkJcTyAL7bVAADStnM-xe8778.jpg', '85', null, '1', '', '\0', '\0', '\0', null, null, '\0', '', '<p style=\"text-align: center;\"><strong><span style=\"font-size: 18px; color: rgb(192, 0, 0);\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJMjSAfEZBAALLSm8fed0014.jpg\" title=\"封面图片.jpg\" alt=\"封面图片.jpg\"/></span></strong></p><h2><span style=\"font-size: 20px; color: rgb(192, 0, 0); background-color: rgb(255, 255, 255);\">物以类聚，人以衫分；</span></h2><h2><span style=\"font-size: 20px; color: rgb(192, 0, 0); background-color: rgb(255, 255, 255);\">文化人的文化衫，专门为文化人打造的文化衫；</span></h2><p><span style=\"color: rgb(192, 0, 0); font-size: 18px;\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJMmKAamC8AAvyyPlBsrQ727.png\" title=\"4.png\" alt=\"4.png\"/></span></p><h2 style=\"text-align: left;\"><span style=\"font-size: 20px; color: rgb(192, 0, 0);\">精致、简单、富有内涵</span></h2><p><span style=\"font-size: 18px; color: rgb(192, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; color: rgb(123, 12, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 15px; text-align: center; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px;\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJMriAHPfZAAmj_ssPxKQ502.png\" title=\"亚麻1.png\" alt=\"亚麻1.png\"/></span></strong></span></p><p><span style=\"font-size: 18px; color: rgb(192, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; color: rgb(123, 12, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 15px; text-align: center; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px;\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJMsWAKHwpAADbx3EVxdk067.png\" title=\"亚麻2.png\" alt=\"亚麻2.png\"/></span></strong></span></p><h2><span style=\"font-size: 20px; color: rgb(192, 0, 0);\">天然植物纤维——亚麻，吸汗排汗，透气凉爽；表面纤维平整光洁，不会促使细菌生长；</span></h2><p><span style=\"font-size: 20px;\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJNV-AFQPFAAvyyPlBsrQ921.png\" title=\"4.png\" alt=\"4.png\"/></span></p><h2><span style=\"font-size: 20px; color: rgb(192, 0, 0);\">纯白面料底色，明亮、朴素、纯洁、雅致，唯有白色，方能配得上中国水墨的含情脉脉；</span></h2><p><span style=\"color: rgb(12, 12, 12); font-size: 20px;\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJNZKAR8FSAAFTQky9zb0371.jpg\" title=\"领口.jpg\" alt=\"领口.jpg\"/></span></p><h2><span style=\"font-size: 20px; color: rgb(192, 0, 0);\">中式领口，中式传统开领设计，弧形线条优雅；</span></h2><h2><span style=\"font-size: 20px; color: rgb(192, 0, 0);\">中式盘扣，经典盘扣，与衣服整体呼应，彰显大气儒雅；</span></h2><p><span style=\"color: rgb(12, 12, 12); font-size: 20px;\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJNeSAJKmfAAK51OsMR0c733.jpg\" title=\"袖口、下摆.jpg\" alt=\"袖口、下摆.jpg\"/></span></p><h2><span style=\"font-size: 20px; color: rgb(192, 0, 0);\">袖口、下摆自然、平整，纯手工制作，无线头</span></h2><p><span style=\"font-size: 18px; color: rgb(192, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; color: rgb(123, 12, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 15px; text-align: center; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: medium; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px; color: rgb(123, 12, 0);\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJNh2AcyRtAADPchaCYBM327.jpg\" title=\"商品详情.jpg\" alt=\"商品详情.jpg\"/></span></strong></span></strong></span></p><p><span style=\"font-size: 18px; color: rgb(192, 0, 0);\"><strong style=\"margin: 0px; padding: 0px; color: rgb(123, 12, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 15px; text-align: center; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: medium; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px; color: rgb(123, 12, 0);\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJPDOALG4qAAAbnEShdD8113.png\" title=\"尺寸表.png\" alt=\"尺寸表.png\" width=\"341\" height=\"223\"/></span></strong></span></strong></span></p><h2><span style=\"font-size: 20px; background-color: rgb(255, 192, 0); color: rgb(255, 255, 255);\">通过这款文化衫，我们招募88位同行者，加入大咖社群，一起在文化之路深耕细作</span></h2><p style=\"text-align: center;\"><span style=\"font-size: 18px; color: rgb(12, 12, 12); text-decoration: line-through;\"><strong style=\"font-size: 15px; color: rgb(123, 12, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; text-align: center;\">吊牌价：688元</strong></span></p><p style=\"text-align: center;\"><span style=\"font-size: 18px; color: rgb(12, 12, 12); text-decoration: line-through;\"><strong style=\"font-size: 15px; color: rgb(123, 12, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; text-align: center;\">优惠价：199元</strong></span></p><h2><strong><span style=\"color:#ffffff\"><span style=\"font-size: 20px; background-color: rgb(255, 192, 0);\">原价688元，589元的福利只侯88位大咖加入，大咖价</span></span><span style=\"color: rgb(255, 192, 0); font-size: 36px; background-color: rgb(255, 255, 255);\">99元</span><span style=\"color:#ffffff\"><span style=\"font-size: 20px; background-color: rgb(255, 192, 0);\">，你还可以随时参加衣画创意基地线下文化活动</span></span></strong></h2><h2><span style=\"font-size: 36px;\"><strong><span style=\"color: rgb(192, 0, 0);\">来，</span></strong></span><span style=\"font-size: 24px;\"><strong><span style=\"color: rgb(192, 0, 0);\">快来，</span></strong></span><span style=\"font-size: 12px;\"><strong><span style=\"color: rgb(192, 0, 0);\">大咖群等你</span></strong></span></h2><p><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJPo2AXFYJAAAdoQlJfII965.png\" title=\"如何加入.png\" alt=\"如何加入.png\"/></p><p><br/></p><p style=\"text-align: center;\"><strong><span style=\"color: rgb(255, 192, 0); background-color: rgb(192, 0, 0); font-size: 18px;\">添加微信可咨询详情</span></strong></p><p><strong><span style=\"color: rgb(255, 192, 0); background-color: rgb(192, 0, 0); font-size: 18px;\"><br/></span></strong></p><p><strong><span style=\"color: rgb(255, 192, 0); background-color: rgb(192, 0, 0); font-size: 18px;\"><img src=\"http://120.76.79.206/group1/M00/00/40/eExPzlkJQTSAWRbbAAG5SM-pD6A199.jpg\" title=\"小画家二维码.jpg\" alt=\"小画家二维码.jpg\"/></span></strong></p>', '3', '2', '0', '0.00', null, null, null, null, '2018-12-21 14:13:22', '2018-12-21 14:13:22', '');
