INSERT INTO `t_product` VALUES ('28', '7', 'P20180706230600115001', '虚拟商品（购买时无需填写收货地址，测试商品，不发货，不退款）', '0.11', null, 'upload/image/20190416/1555378434063.jpg', '98', '0.00', '1', '', '\0', '\0', '\0', '\0', null, '', null, '<p><span style=\"color: rgb(255, 0, 0); font-size: 12px;\">【特别提醒】<br/>1.购买时无需填写收货地址，测试商品，不发货不退款。<br/>2.该商品可直接修改价格上架销售，或删除。<br/>3.付款成功后，可在“收入/提现”模块查询交易明细，虚拟商品付款后7天可提现。</span></p><p style=\"text-align: left;\"><span style=\"font-size: 18px;\">常见问题</span></p><p><span style=\"font-size: 14px;\">问：虚拟商品使用范围？<br/></span><span style=\"color: rgb(63, 63, 63); font-size: 14px;\">答：虚拟商品适用于门票、会员卡/会员资格/会员服务购买、线下门店体验服务、旅游产品。</span></p><p><span style=\"font-size: 14px;\">问：实物商品和虚拟商品的区别？<br/>答：</span><span style=\"color: rgb(63, 63, 63); font-size: 14px;\">实物商品购买时需要填写收货地址，需通过快递物流发货或送货上门；虚拟商品购买时无需填写收货地址，付款完成获得订单二维码，凭二维码可联系卖家兑现服务。</span></p><p><a target=\"_blank\" href=\"http://bbs.youzan.com/forum.php?mod=viewthread&tid=72813\"><span style=\"font-size: 14px; color: rgb(127, 127, 127); text-decoration: underline;\">查看《有赞商家版虚拟商品管理规范》</span></a><span style=\"font-size: 14px; color: rgb(127, 127, 127); text-decoration: underline;\"><br/></span></p><p style=\"text-align: center;\"><img src=\"http://imgqn.koudaitong.com/upload_files/2015/05/13/Fh1ZR74CpUm0s85svgQuU-MQ3oQd.png!730x0.jpg\"/><img src=\"http://imgqn.koudaitong.com/upload_files/2015/05/13/Fvwmfd5yCOCSL60EHxmO0WUqguM3.png!730x0.jpg\"/><img src=\"http://imgqn.koudaitong.com/upload_files/2015/05/13/FoMCEwRpIbleJqCh7A---MZ-JvUc.png!730x0.jpg\"/></p>', '7', '18', '0', '0.00', null, null, null, null, '2019-04-16 09:35:20', '2019-04-16 09:35:16', '');
